import { useEffect, useState } from 'react'
import axios from 'axios';


const Products_sv = ()=>{
    const [DATA, setData] = useState([]);
    const fetchData = async () => {
        const result = await axios.get('/api/products');
        setData(result.data);
      };
      fetchData();
    // useEffect(() => {

    // }, []);
    return DATA;
};




 export default Products_sv;
